def find_zero(xs: list):
    if len(xs) % 2 != 0 or xs[-1] == 0:
        raise ValueError("Polynomial must have even number of coefficients and largest non zero coefficient")

    left, right = 0, 1
    while left <= right:
        mid = (left + right) / 2
        if poly(xs, mid) == 0:
            return mid
        elif poly(xs, mid) < 0:
            left = mid + 1
        else:
            right = mid - 1

    raise ValueError("No zero found in the given polynomial")

